    <style>

        /* Dots */
        .dot-container {
            text-align: center;
            padding: 16px;
        }

        .dot {
            cursor: pointer;
            height: 15px;
            width: 15px;
            margin: 0 2px;
            background-color: #bbb;
            border-radius: 50%;
            display: inline-block;
            transition: background-color 0.6s ease;
        }

        .active, .dot:hover {
            background-color: #717171;
        }

        /* Updated CSS for slide images */
        .content-slide {
            display: none; /* Hide slides by default */
            width: 60vw; /* 1/3 of the viewport width */
            height: 60vh; /* 1/3 of the viewport height */
            object-fit: contain; /* Cover the designated area, may cause distortion */
        }

        /* Popup Overlay */
        .content-popup {
            position: fixed; /* Stay in place */
            z-index: 1; /* Sit on top */
            left: 0;
            top: 0;
            width: 100%; /* Full width */
            height: 100%; /* Full height */
            overflow: auto; /* Enable scroll if needed */
            background-color: rgb(0,0,0); /* Fallback color */
            background-color: rgba(0,0,0,0.4); /* Black w/ opacity */
            display: flex; /* Enable flexbox */
            justify-content: center; /* Center horizontally */
            align-items: center; /* Center vertically */
        }

        /* Popup Content */
        .content-popup-content {
            top: 10vh;
            position: relative;
            background-color: #fefefe;
            margin: auto;
            padding: 10px;
            border: 1px solid #888;
            width: 80%; /* Adjust if necessary to accommodate slides */
            height: auto;
            /* Removed max-width: none; to ensure the content is not too wide */
            display: flex; /* Use flexbox to align items */
            justify-content: center; /* Center items horizontally */
            align-items: center; /* Center items vertically */
            flex-direction: column; /* Stack items vertically */
            box-shadow: 0 4px 8px 0 rgba(0,0,0,0.2), 0 6px 20px 0 rgba(0,0,0,0.19); /* Optional: Adds shadow for better visibility */
        }


        /* Adjust the Previous and Next button positioning */
        .content-prev, .content-next {
            cursor: pointer;
            position: absolute;
            top: 50%; /* Center vertically */
            transform: translateY(-50%); /* Adjust alignment */
            width: auto;
            margin-top: 0;
            padding: 16px;
            color: white;
            font-weight: bold;
            font-size: 18px;
            transition: 0.6s ease;
            user-select: none;
        }

        .content-next {
            right: 10px; /* Position to the right */
        }

        .content-prev {
            left: 10px; /* Position to the left */
        }



        /* Popup window */
        .content-popup {
            display: none; /* Hidden by default */
            top: 0;
            position: fixed; /* Stay in place */
            z-index: 1; /* Sit on top */
            left: 0;
            width: 100%; /* Full width */
            height: 100%; /* Full height */
            overflow: auto; /* Enable scroll if needed */
            background-color: rgb(0,0,0); /* Fallback color */
            background-color: rgba(0,0,0,0.4); /* Black w/ opacity */
        }

        /* The Close Button */
        .content-close {
            color: #aaa;
            font-size: 28px;
            font-weight: bold;
        }

        .content-close:hover,
        .content-close:focus {
            color: black;
            text-decoration: none;
            cursor: pointer;
        }








        .content-more-dots {
            margin: 0 5px;
            font-size: 24px;
            display: inline-block;
            cursor: pointer;
        }

        .content-icon {
            cursor: pointer;
            height: 15px;
            width: 15px;
            margin: 0 2px;
            border-radius: 50%;
            display: inline-block;
            transition: background-color 0.6s ease;
        }

        .content-slideshow-container {
            width: 100%; /* Adjust based on preference */
            max-width: 1000px; /* Maximum size */
            height: auto; /* Adjusted to 'auto' to accommodate varying content sizes */
            margin: auto; /* Margin auto for horizontal centering, 20px for some spacing from top/bottom */
            position: relative;
            box-shadow: 0 4px 8px rgba(0,0,0,0.1); /* Optional: adds shadow for depth */
            overflow: hidden;
            border-radius: 10px; /* Optional: adds rounded corners */
            display: flex; /* Added for vertical alignment */
            flex-direction: column; /* Stack children vertically */
            justify-content: center; /* Center children vertically */
        }

        .content-dot-container-frame {
            width: 100%; /* Adjust based on preference */
            max-width: 1000px; /* Maximum size */
            height: auto; /* Adjusted to 'auto' to accommodate varying content sizes */
            margin: auto; /* Margin auto for horizontal centering, 20px for some spacing from top/bottom */
            position: relative;
            overflow: hidden;
            border-radius: 10px; /* Optional: adds rounded corners */
            display: flex; /* Added for vertical alignment */
            flex-direction: column; /* Stack children vertically */
            justify-content: center; /* Center children vertically */
        }

        .content-slide img {
            max-height: 100%;
            max-width: 100%;
            object-fit: contain; /* Ensures no distortion */
        }

        .content-active {
            display: flex;
        }

        .content-prev, .content-next {
            cursor: pointer;
            position: absolute;
            width: auto;
            padding: 16px;
            color: white;
            font-weight: bold;
            font-size: 18px;

        }

        .content-next {
            right: 0;

        .content-prev {
            left: 0;
        }






        .content-dot-container {
            text-align: center;
            padding: 20px;
            background: #ddd;
            width: 100%; /* Ensure it spans the full width of the slideshow container */
            max-width: fit-content; /* Maximum size */
            margin: auto; /* Margin auto for horizontal centering, 20px for some spacing from top/bottom */
            position: relative;

            border-radius: 50%;
            display: inline-block;

<script>
    // Get elements
    var popup = document.getElementById("slideshowPopup");
    var btn = document.getElementById("openSlideshow");
    var span = document.getElementsByClassName("content-close")[0];
    var slides = document.getElementsByClassName("content-slide");
    var prev = document.querySelector(".content-prev");
    var next = document.querySelector(".content-next");

    var slideIndex = 1;
    showSlides(slideIndex);

    // Open the popup
    btn.onclick = function() {
        popup.style.display = "block";
        showSlides(slideIndex = 1);
    }

    // Close the popup
    span.onclick = function() {
        popup.style.display = "none";
    }

    // Next/previous controls
    function plusSlides(n) {
        showSlides(slideIndex += n);
    }

    prev.onclick = function() {
        plusSlides(-1);
    }

    next.onclick = function() {
        plusSlides(1);
    }




    var slideIndex = 1;
    showSlides(slideIndex);

    function changeSlide(n) {
        showSlides(slideIndex += n);
    }

    function nextSlide() {
        changeSlide(1); // This will increment the slideIndex by 1 and show the next slide
    }

    function prevSlide() {
        changeSlide(-1); // Corrected to use changeSlide for decrement
    }

    function currentSlide(n) {
        showSlides(slideIndex = n); // Corrected to properly use the parameter 'n'
    }

    function showSlides(n) {
        var i;
        var slides = document.getElementsByClassName("content-slide");
        var dots = document.getElementsByClassName("content-dot");
        if (n > slides.length) {slideIndex = 1}
        if (n < 1) {slideIndex = slides.length}
        for (i = 0; i < slides.length; i++) {
            slides[i].style.display = "none";
        }
        for (i = 0; i < dots.length; i++) {
            dots[i].className = dots[i].className.replace(" content-active-dot", "");
        }
        slides[slideIndex-1].style.display = "block";
        dots[slideIndex-1].className += " content-active-dot";
    }

    // Optional: Resetting Auto navigation upon manual changes
    function resetSlideInterval() {
        clearInterval(slideInterval);
        slideInterval = setInterval(function() { changeSlide(1); }, 2000);
    }

    // Directly using pauseSlideShow and resumeSlideShow to control the slideshow
    var slideInterval = setInterval(function() { changeSlide(1); }, 2000); // Auto-change slides

    // Pause and Resume functions
    function pauseSlideShow() {
        clearInterval(slideInterval);
    }

    function resumeSlideShow() {
        resetSlideInterval(); // Calls reset to resume auto-navigation
    }


    // Close the popup when clicking outside of it
    window.onclick = function(event) {
        if (event.target === popup) {
            popup.style.display = "none";
        }
    }







</script>
